import "./App.css";
import { useState, useEffect } from "react";

// quick helper function to easily convert to title case
function titleCase(str) {
    return str.toLowerCase().replace("-", " ").split(' ').map(w => w[0].toUpperCase() +
           w.substring(1).toLowerCase()).join(' ');
}

// transfers all planes into planeBox on app start
const origData = require("./data.json");
origData.planes.forEach((plane) => {
    plane.spot = "planeBox";
    origData.spots.planeBox.plane.push(plane);
});

function RampBox({ moveMode, setMoveMode, moveHere }) {
    return (
        <div id="ramp" className="box">
            <div className="box title-box" style={{"fontSize": 1.5+"em"}}>
                Ramp
            </div>
            <table className="table-list" border="1" frame="void" rules="rows">
                <tbody>
                    <RampBoxItem name="ramp-a" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-b" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-c" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-d" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-e" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-f" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-g" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-h" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-i" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-j" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-k" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-l" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-m" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-n" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-o" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-p" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-q" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                    <RampBoxItem name="ramp-r" moveMode={moveMode} setMoveMode={setMoveMode}
                        moveHere={moveHere} />
                </tbody>
            </table>
        </div>
    );
}

function RampBoxItem({ name, moveMode, setMoveMode }) {
    const [spotData, setSpotData] = useState(null);
    useEffect(() => {
        async function getSpotData() {
            const response = await fetch("http://localhost:8080/getSpot?spot=" + name);
            return response.json();
        }
        getSpotData()
            .then(spotData => setSpotData(spotData))
            .catch(e => console.log(e));
    }, [name]);


    async function customMoveHere() {
        if (moveMode) {
            fetch("http://localhost:8080/movePlane?plane=" + moveMode + "&spot=" + name)
                //.then(response => response.json())
                //.then(newSpotData => setSpotData(newSpotData))
                .catch(e => console.log(e));
            setMoveMode(null);
        }
    }

    // also look into React Context !!

    if (spotData) {
        let plane;
        if (spotData.plane) {
            plane = (
                <Plane plane={spotData.plane} moveMode={moveMode} setMoveMode={setMoveMode} />
            );
        }
        let glow = (moveMode && !spotData.plane ? "glow" : "");
        let upperChar = name.replace("ramp-", "").toUpperCase();
        return (
            <tr id={name} className={glow} onClick={() => customMoveHere()}>
                <td>{upperChar}</td>
                <td>{plane}</td>
            </tr>
        );
    }
}

function DirectionBox({ data, updateData, moveMode, setMoveMode, moveHere }) {
    return (
        <div id="direction" className="box">
            <table className="center-table" border="1" frame="void">
                <tbody>
                    <tr>
                        <DirectionBoxItem name="xc-1" data={data} updateData={updateData}
                            moveMode={moveMode} setMoveMode={setMoveMode} moveHere={moveHere} />
                        <td>
                            <table className="center-table" border="1" frame="void">
                                <tbody>
                                    <tr>
                                        <DirectionBoxItem name="kmcx"
                                            data={data} updateData={updateData}
                                            moveMode={moveMode} setMoveMode={setMoveMode}
                                            moveHere={moveHere} />
                                    </tr>
                                    <tr>
